ברוכים הבאים לתרגיל השביעי!  

התרגיל נלקח מתוך הרצאה שהעברתי על מה זה להיות דאטה אנליסט בתחום ההונאות :)

## שאלה

קיבלתם מייל מהמנהל שלכם עם תהייה לגבי קפיצה בהרשמות אצל לקוח מסוים שאתם עובדים איתו. הוא צירף למייל את הגרף הבא:

![](reg_count_plot.png)


אתם והמנהל חושדים שיש קבוצת בוטים שהצליחה לעקוף את המנגנונים שלכם ונרשמה יחד עם יוזרים רגילים. נסו למצוא את הקבוצה מתוך סך הנרשמים לחודש ינואר.
את הפלט הציגו באמצעות אגרגציה יומית של עמודה הסוכמת את מספר הבוטים שזיהיתם ועמודה שמראה את היוזרים 'שאינם בוטים'.


<details>
<summary>רמז</summary>
נסו לחפש דפוס בפרטים של היוזרים שתוכלו ליישם כלוגקיה לזהות קבוצה של יוזרים.
</details>



## הדאטה

התרגיל מורכב ממדגם הרשמות של יוזרים באתר לחודש ינואר:


::: {.cell}

```{.sql .cell-code}
SELECT TOP 5 * 
FROM registrations_7
```


