## נסו בעצמכם

### אונליין 

<mark>נסו בחלון טקסט למטה (SQLite):</mark>

```{.sql .interactive .money_laundering_q8}
-- EDIT THIS QUERY:
SELECT *
FROM ml_payments
LIMIT 10;

```


