#### SQLite


::: {.cell}

```{.sql .cell-code}
SELECT registration_date,
  SUM(CASE WHEN email LIKE SUBSTR(first_name, 1 ,1 ) || last_name || '__@%' THEN 1 ELSE 0 END) as fraud_group,
  COUNT(*) - SUM(CASE WHEN email LIKE SUBSTR(first_name, 1 ,1 ) || last_name || '__@%' THEN 1 ELSE 0 END) as Not_Group
FROM registrations_7
GROUP BY registration_date
ORDER BY registration_date
```
:::


#### T-SQL


::: {.cell}

```{.sql .cell-code}
SELECT registration_date,
  SUM(CASE WHEN email LIKE LEFT(first_name, 1) + last_name+'__@%' THEN 1 END) as fraud_group,
  COUNT(*) - SUM(CASE WHEN email LIKE LEFT(first_name, 1) + last_name+'__@%' THEN 1 END) as Not_Group
FROM registrations_7
GROUP BY registration_date
ORDER BY registration_date
```
